import React, { useEffect, useState } from 'react';
import './ReviewPage.css';

const ReviewPage = () => {
  const [flashcards, setFlashcards] = useState([]);
  const [filteredCards, setFilteredCards] = useState([]);
  const [selectedMark, setSelectedMark] = useState(null);
  const [history, setHistory] = useState([]);
  const [selectedUpload, setSelectedUpload] = useState(null);

  // Load all flashcards (history)
  useEffect(() => {
    const saved = JSON.parse(localStorage.getItem('flashcardHistory')) || [];
    setHistory(saved);
    if (saved.length > 0) {
      setSelectedUpload(saved[saved.length - 1]); // default to latest
      setFlashcards(saved[saved.length - 1].cards);
    }
  }, []);

  // Filter flashcards by marks
  const handleFilter = (marks) => {
    setSelectedMark(marks);
    if (!selectedUpload) return;
    setFilteredCards(selectedUpload.cards.filter((c) => c.marks === marks));
  };

  const handleSelectUpload = (upload) => {
    setSelectedUpload(upload);
    setFlashcards(upload.cards);
    setSelectedMark(null);
    setFilteredCards([]);
  };

  const countByMarks = (marks) =>
    selectedUpload?.cards.filter((c) => c.marks === marks).length || 0;

  return (
    <div className="review-page-container">
      {/* Left Sidebar */}
      <div className="history-sidebar">
        <h3>ðŸ“œ Upload History</h3>
        {history.length === 0 && <p>No uploads yet.</p>}
        {history.map((upload, idx) => (
          <button
            key={idx}
            className={`history-btn ${selectedUpload === upload ? 'active' : ''}`}
            onClick={() => handleSelectUpload(upload)}
          >
            Upload {idx + 1} - {upload.date}
          </button>
        ))}
      </div>

      {/* Main Review Area */}
      <div className="review-main">
        <h2>ðŸ“š Review Flashcards</h2>

        {/* Mark filter buttons */}
        <div className="filter-buttons">
          <button onClick={() => handleFilter(1)}>1 Mark ({countByMarks(1)})</button>
          <button onClick={() => handleFilter(2)}>2 Marks ({countByMarks(2)})</button>
          <button onClick={() => handleFilter(5)}>5 Marks ({countByMarks(5)})</button>
          <button onClick={() => handleFilter(10)}>10 Marks ({countByMarks(10)})</button>
        </div>

        {/* Show flashcards */}
        {!selectedMark && (
          <div className="card-list">
            {flashcards.length === 0 && <p>No flashcards for this upload.</p>}
            {flashcards.map((card, idx) => (
              <div key={idx} className="flashcard">
                <div className="question">Q: {card.question}</div>
                <div className="answer">A: {card.answer}</div>
                <div className="marks">ðŸŽ¯ Marks: {card.marks}</div>
              </div>
            ))}
          </div>
        )}

        {selectedMark && filteredCards.length === 0 && (
          <p>No flashcards found for {selectedMark} Marks.</p>
        )}

        {selectedMark && filteredCards.length > 0 && (
          <div className="card-list">
            {filteredCards.map((card, idx) => (
              <div key={idx} className="flashcard">
                <div className="question">Q: {card.question}</div>
                <div className="answer">A: {card.answer}</div>
                <div className="marks">ðŸŽ¯ Marks: {card.marks}</div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default ReviewPage;
